export function Logo({
    size = 36,
    height,
    width,
}: {
    size?: number;
    height?: number;
    width?: number;
}) {
    const { theme } = useContext(ThemeContext);

    return (
        <Image
            height={height ?? size}
            layout="constrained"
            src={getImageUrl(`logo.${theme}.png`)}
            width={width ?? size}
        />
    );
}

